Working with Loops in Inngest
Simple function example
TypeScript Go Python
Let's start with a simple example to illustrate the concept:
Copy Copied
```
inngest .createFunction (
{ id : "simple-function" } ,
{ event : "test/simple.function" } ,
async ({ step }) => {
console .log ( "hello" );

await step .run ( "a" , async () => { console .log ( "a" ) });
await step .run ( "b" , async () => { console .log ( "b" ) });
await step .run ( "c" , async () => { console .log ( "c" ) });
}
);
```
In the above example, you will see "hello" printed four times, once for the initial function entry and once for each step execution (
```
a
```
,
```
b
```
, and
```
c
```
).
✅ How Inngest executes the code ❌ Common incorrect misconception
Copy Copied
```
# This is how Inngest executes the code above:

< run start >
"hello"

"hello"
"a"

"hello"
"b"

"hello"
"c"
< run complete >
```
Any non-deterministic logic (like database calls or API calls) must be placed inside a
```
step.run
```
call to ensure it is executed correctly within each step.
With this in mind, here is how the previous example can be fixed:
Copy Copied
```
inngest .createFunction (
{ id : "simple-function" } ,
{ event : "test/simple.function" } ,
async ({ step }) => {
await step .run ( "hello" , () => { console .log ( "hello" ) });

await step .run ( "a" , async () => { console .log ( "a" ) });
await step .run ( "b" , async () => { console .log ( "b" ) });
await step .run ( "c" , async () => { console .log ( "c" ) });
}
);

// hello
// a
// b
// c
```
Now, "hello" is printed only once, as expected.

Working with Loops in Inngest
Loop example
TypeScript Go Python
Here's
[an example](\blog\import-ecommerce-api-data-in-seconds)
of an Inngest function that imports all products from a Shopify store into a local system. This function iterates over all pages combining all products into a single array.
Copy Copied
```
export default inngest .createFunction (
{ id : "shopify-product-import" } ,
{ event : "shopify/import.requested" } ,
async ({ event , step }) => {
const allProducts = []
let cursor = null
let hasMore = true

// Use the event's "data" to pass key info like IDs
// Note: in this example is deterministic across multiple requests
// If the returned results must stay in the same order, wrap the db call in step.run()
const session = await database .getShopifySession ( event . data .storeId)

while (hasMore) {
const page = await step .run ( `fetch-products- ${ pageNumber } ` , async () => {
return await shopify . rest . Product .all ({
session ,
since_id : cursor ,
})
})
// Combine all of the data into a single list
allProducts .push ( ... page .products)
if ( page . products . length === 50 ) {
cursor = page .products[ 49 ].id
} else {
hasMore = false
}
}

// Now we have the entire list of products within allProducts!
}
)
```
In the example above, each iteration of the loop is managed using
```
step.run()
```
, ensuring that
**all non-deterministic logic (like fetching products from Shopify) is encapsulated within a step**
. This approach guarantees that if the request fails, it will be retried automatically, in the correct order. This structure aligns with Inngest's execution model, where each step is a separate HTTP request, ensuring robust and consistent loop behavior.
Note that in the example above
```
getShopifySession
```
is deterministic across multiple requests (and it's added to all API calls for authorization). If the returned results must stay in the same order, wrap the database call in
```
step.run()
```
.
Read more about this use case in the
[blog post](\blog\import-ecommerce-api-data-in-seconds)
.
